import React, { useState, useCallback } from 'react';
import { Button, Result, Typography } from 'antd';
import {Link} from 'react-router-dom'


const { Title, Paragraph , Text} = Typography;

const RegisterFace = (props) => {

    return (
      <div className='app'>
        <Title>영상 녹화 방법</Title>
        <img src="https://user-images.githubusercontent.com/60956392/97309239-1b341280-18a5-11eb-9c95-2b55d29d4eff.gif" alt="guide"/>
        <Paragraph> 위와 같이 최대한 <Text strong>상, 하, 좌, 우</Text> 다양한 각도로 얼굴을 찍어주세요. </Paragraph>
        <div>
          <Link to='/face/webcam'>
          <img src="https://user-images.githubusercontent.com/60956392/97286561-f3ce4d00-1886-11eb-9d5f-6ad6444049c5.png" alt="webcam" />
          </Link>
        </div>
        <div>
          <Link to='/face/upload'>
          <img src="https://user-images.githubusercontent.com/60956392/97286554-f0d35c80-1886-11eb-98ff-0e96b4939522.png" alt="upload"/>
          </Link>
        </div>
        </div>

    );

};

export default RegisterFace;
